export default {
	items: Get_Units.data,
	getItems: async () => {
		//use async-await or promises
		if(!Get_Units.data) {
			await Get_Units.run();
		}
		this.items = Get_Units.data;
		return this.items;
	},
	options : () => {
		let options = [];
		if(this.items) {
			this.items.forEach(function(item){
				options.push({
					label : item.pp_name,
					value : item.pp_unitid
				});
			});
		}
		return options;
	}
}
